// colors selected from material color palette
// https://material.io/guidelines/style/color.html#color-color-palette
export var YELLOW = '#FFEB3B';
export var AMBER = '#FFC107';
export var GREY = '#607D8B';
export var WHITE = '#FFFFFF';
export var LIGHT_BLUE = '#2196F3';
export var INDIGO_LIGHT = '#E8EAF6';
var defaultTheme = {
  sunColor: YELLOW,
  raysColor: AMBER,
  cloudsColor: GREY,
  dropsColor: LIGHT_BLUE,
  snowColor: LIGHT_BLUE,
  boltColor: LIGHT_BLUE,
  backgroundColor: WHITE
};
export default defaultTheme;
